import React from "react";
import ContactForm from "./ContactForm";

const Contact=()=>{
    return (
        <>
            <div class="jumbotron jumbotron-fluid">
                <div class="container">
                    <h1 class="display-4">Contact Register</h1>
                </div>
            </div>
            <div className="row">
                <div className="col-md-5">
                    <ContactForm/>
                </div>
                <div className="col-md-7">
                    <div>
                        List of contacts
                    </div>

                </div>
            </div>
        </>
    );
}

export default Contact;
